import React from "react";
import "./Content.css";
const Content = (props) => {
  return (
    <div className="content-container">
      {props.data.map((item) => {
        <div className="items-container">
            <span class="picture-container">
               <img src={item.src}/>
            </span>
            <div className="course-info">
                <p>{item.name}</p>
                <div>
                    <span>{item.hours}</span>
                    <span></span>
                </div>
            </div>
        </div>
      })}
    </div>
  );
};

export default Content;
